import React, { Component } from "react";
import {
  Grid,
  List,
  Header,
  Pagination,
  Segment,
  Image
} from "semantic-ui-react";

class About extends Component {
  render() {
    return (
      <Grid columns={3} stackable>
        <Grid.Row stretched>
          <Grid.Column stackable>
            <Segment>
              <div>
                <Image src="linkedin.jpg" size="medium" rounded />
                <Header size="large">Gregory Pothier</Header>
                Hello! Welcome to my website, please make yourself at home and browse around.
              </div>
            </Segment>
          </Grid.Column>
          <Grid.Column>
            <Segment>

            </Segment>
            <Segment>Currently Reading</Segment>
          </Grid.Column>
          <Grid.Column>
            <Segment>Currently Watching</Segment>
            <Segment>Currently in Rotation</Segment>
          </Grid.Column>
        </Grid.Row>
      </Grid>
    );
  }
}
export default About;
